import Card from '../Card/Card'
import styles from './Cards.module.css'


const recipes = useSelector(state=>state.recipes)

const Cards = () => {
  return (
    <div className={styles.container}>
      
      {recipes.map(recipe =>{
        return <Card 
        name={recipe.name}
        image={recipe.image}
        diet={recipe.diets}

        />
      })}
      


    </div>
  )
}

export default Cards
